Rendering primitives in Nogine is as simple as calling the associated draw function . These are the available primitives and their draw functions: Rects: ::draw_rect() and ::draw_rect_full(). Circles: ::draw_circle() and ::draw_ellipse(). Polygons: ::draw_polygon() and ::draw_polygon_ext(). Now, with the following configuration you should get something like the following image: Graphics::set_cam(Vector2::ZERO, Vector2(1.5 * window.aspect_ratio(), 1.5)); Graphics::draw_rect(Vector2(-1.55, -0.5), Vector2::ONE, Color4::CYAN);
Graphics::draw_circle(Vector2::ZERO, 0.5, Color4::YELLOW);
Graphics::draw_polygon(Vector2(1.0, 0.0), 0.5, 0.0, 6, Color::PINK); A cyan square, a yellow circle and a pink hexagon

