Before rendering a texture, it's necessary to load it from disk or from memory. To do this, we'll use the ::load() method from the Texture type. This method accepts a reader and a configuration and returns a Result<Texture, _>. For example, we could do something like this: let file = File::open("texture.png").unwrap();
let buf_reader = BufReader::new(file);
let texture = Texture::load(&buf_reader, Default::default()).unwrap();

