To render textures we can use the functions ::draw_texture() and ::draw_texture_full(). The size of the texture will depend on the pixels per unit and will keep its aspect ratio, unless it's explicitly scaled. For example, this is the code we would use to render the texture we previously loaded into the screen: let file = File::open("texture.png").unwrap();
let buf_reader = BufReader::new(file);
let texture = Texture::load(&buf_reader, Default::default()).unwrap(); Graphics::draw_texture(Vector2::ZERO, Vector2::ONE, 0.0, &texture);

